import React, { Fragment } from "react";

const Header = () => {
  return (
    <Fragment>
      <div>
        
        <select>
          <option value="value1">Value 1</option>
          <option value="value2" selected>
            Value 2
          </option>
          <option value="value3">Value 3</option>
        </select>
      </div>
    </Fragment>
  );
};

export default Header;
